  true,\n\t\"url\": null,\n\t\"notes\": \"The Environment Statistics Database contains
  selected water and waste statistics by country. Statistics on water and waste are
  based on official statistics supplied by national statistical offices and/or ministries
  of environment (or equivalent institutions) in countries in response to the biennial
  UNSD/UNEP Questionnaire on Environment Statistics. They were complemented by data
  on EU and OECD member and partner countries from OECD and Eurostat. Environment
  statistics is still in an early stage of development in many countries, and data
  are often sparse. The statistics selected here are those of relatively good quality
  and geographic coverage. The online database currently covers the years 1990, 1995
  to 2009. For information on definitions, data quality and other important metadata,
  please check UNSD Environmental Indicator tables.Last update in UNdata: 19 Sep 2011Next
  update in UNdata: Jul 2013\",\n\t\"license_title\": \"Creative Commons Attribution\",\n\t\"extras\":
